import React from "react";
import classes from "../components/MainNavigation.module.css";
import { Link } from "react-router-dom";
const PRODUCTS = [
  { id: "p1", title: "Product-1" },
  { id: "p2", title: "Product-2" },
  { id: "p3", title: "Product-3" },
  { id: "p4", title: "Product-4" },
];
function Products() {
  return (
    <div>
      <h1 className={classes.header}>Products</h1>
      <ul>
        <li>
          <Link to="/products/product-1">Product 1</Link>
        </li>
        <li>
          <Link to="/products/product-2">Product 2</Link>
        </li>
        <li>
          <Link to="/products/product-3">Product 3</Link>
        </li>
        <li>
          <Link>Product 4</Link>
        </li>
      </ul>
    </div>
  );
}

export default Products;
